import React, { useContext, useEffect } from "react";

import Badge from "react-bootstrap/Badge";
import ListGroup from "react-bootstrap/ListGroup";

import { DataContext } from "../../App/index.jsx";

import getPriceStock from "../../Services/index.js";

const ListHistory = () => {
  const { 
    state, 
    dispatch, 
    actions } = useContext(DataContext);

    const { setReload, fetchStocks, fetchStocksSuccess, fetchStocksError } = actions;



  useEffect( () => {

    const fetchData = async () => {
      dispatch({ type: fetchStocks })
      try {
        const res = await getPriceStock();

        if (res.status == 200) {
          dispatch({ type: fetchStocksSuccess, payload: res.data.priceStockList })
        }
      } catch (error) {
        dispatch({ type: fetchStocksError, payload: error })
      }

      fetchData();

    }
  }, [state.priceStockList]);

  const isStateEmpty = () => {
    return state.priceStockList === null;
  };

  return (
    <>
      {isStateEmpty() ? (
        <ListGroup as="ol" numbered>
          <ListGroup.Item
            as="li"
            className="d-flex justify-content-between align-items-start"
          >
            <div className="ms-2 me-auto">
              <div className="fw-bold">dwadwad</div>
              Cras justo odi
            </div>
            <Badge bg="primary" pill>
              14
            </Badge>
          </ListGroup.Item>
        </ListGroup>
      ) : (
        <ListGroup as="ol" numbered>
          {state.priceStockList.map((item) => (
            <ListGroup.Item
              as="li"
              className="d-flex justify-content-between align-items-start"
              key={item.id}
            >
              <div className="ms-2 me-auto">
                <div className="fw-bold">{item.low}</div>
                {item.last}
              </div>
              <Badge bg="primary" pill>
                14
              </Badge>
            </ListGroup.Item>
          ))}
        </ListGroup>
      )}
    </>
  );
};

export default ListHistory;
